import React from "react";
import { Button } from "react-bootstrap";


const ReadOnlyRow = ({ contact, handleEditClick, handleDeleteClick }) => {
  return (
    <>
      <tr  className="d-flex justify-content-between">
        <td className="text-left">{contact.fullName}</td>
        <td className="text-right">{contact.address}</td>
        {/* <td>{contact.phoneNumber}</td>
        <td>{contact.email}</td> */}
      </tr>
      <tr className="px-0 d-flex justify-content-between">
        <td className="px-0 d-flex">
          <Button
            className="mx-1 btn-sm btn-secondary"
            type="button"
            onClick={(event) => handleEditClick(event, contact)}
          >
            Edit
          </Button>

          <Button type="button" className="btn-sm btn-secondary" onClick={() => handleDeleteClick(contact.id)}>
            Delete
          </Button>
        </td>
      </tr>
    </>
  );
};

export default ReadOnlyRow;
